import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';


const Navbar = () => {
    const [dropdownVisible, setDropdownVisible] = useState(false);
    const dropdownRef = useRef(null);
    const navigate = useNavigate();

    const toggleDropdown = () => {
        setDropdownVisible(!dropdownVisible);
    };

    const handleClickOutside = (event) => {
        if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
            setDropdownVisible(false);
        }
    };

    const handleDirectory = ()=>{
        navigate('/alumnidirectory')
    }

    useEffect(() => {
        document.addEventListener('click', handleClickOutside);
        return () => {
            document.removeEventListener('click', handleClickOutside);
        };
    }, []);

    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-primary">
            <div className="container-fluid">
                <button
                    className="navbar-toggler"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#navbarNav"
                    aria-controls="navbarNav"
                    aria-expanded="false"
                    aria-label="Toggle navigation"
                >
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav ms-auto">
                        <li className="nav-item">
                            <a className="nav-link text-light" aria-current="page" href="#">
                                Home
                            </a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link text-light" href="#">
                                About
                            </a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link text-light" href="#">
                                Contact Us
                            </a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link btn btn-outline-light me-2" href="/option">
                                Sign Up
                            </a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link btn btn-outline-light me-2" href="#">
                                Login
                            </a>
                        </li>
                    </ul>
                </div>

                <div className="dropdown" ref={dropdownRef}>
                    <button
                        className="btn btn-secondary dropdown-toggle"
                        type="button"
                        onClick={toggleDropdown}
                        aria-expanded="false"
                    >
                        Explore
                    </button>
                    <ul
                        className={`dropdown-menu dropdown-menu-end ${dropdownVisible ? 'show' : ''}`}
                        style={{
                            backgroundColor: 'white',
                            width: '300px',
                            height: 'calc(100vh - 56px)',
                            top: '56px',
                            right: dropdownVisible ? '0' : '-300px',
                            display: dropdownVisible ? 'block' : 'none',
                            position: 'fixed',
                            zIndex: '1050',
                            transition: 'right 0.4s ease',
                        }}
                    >
                        <li>
                            <a className="dropdown-item" href="#">
                                Alumni Directory
                            </a>
                        </li>
                        <li>
                            <a className="dropdown-item" href="#">
                                Option 2
                            </a>
                        </li>
                        <li>
                            <a className="dropdown-item" href="#">
                                Option 3
                            </a>
                        </li>
                        <li>
                            <a className="dropdown-item" href='#'>
                                Option 4
                            </a>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
